import React from 'react';
import ListMenu from './list_menu/list_menu';
import './navbar.scss';

function Navbar() {

    return (
        <nav className="navigation-bar">
            <img className="logo" alt="logo" src="#"></img>
            <a href="#">Sign In</a>
            <ListMenu />
        </nav>
    );
}

export default Navbar;
